function  onClick(id) {
    alert("Clicked" + id);
}

const GameCircle = ({id, color, children}) => {
    console.log("GameCircle", id, color);
    return <div style={{backgroundColor: color}}  onClick={()=>onClick(id)}> 
        {children}
         </div>;
}

export default GameCircle;
